import React from 'react';
import { dummyPost } from '../dummy.js';
import styled from 'styled-components';

export const Postform = styled.div`
width: 260px;
height: 300px;
background-color: yellow;
`
export const Postcontent = styled.div`
white-space: nowrap;
overflow:hidden;
text-overflow: ellipsis;
`
export default function Boardpostform(){
    return(
        <center>
            <Postform>
            <img className='item-img' src={dummyPost[0].image} alt={dummyPost[0].title} />
            <div className='item-name' >{dummyPost[0].title}</div>
            <br /><br /><br />
            <Postcontent>{dummyPost[0].contents}</Postcontent>
            <div className='item-price' >{dummyPost[0].total_likes}</div>
            </Postform>
        </center>
    )
}
